func:
//Load our global variables
var numFields = flow.get('numFields')||0;
var queueCount = flow.get('queueCount')||0;
var foundNumFields = flow.get('foundNumFields')||false;
var sentTimestampVal = flow.get('sentTimestampVal')||false;

node.warn(
    "numFields = " + numFields +
    " queueCount = " + queueCount +
    " foundNumFields = " + foundNumFields +
    " sentTimestampVal = " + sentTimestampVal
    );

var myMsg = {payload:'timestamp'};  //The first message to send of the lot

//If this is the very first message, make it into a header field called "timestamp"
if(numFields == 0){
    numFields = 1;
    node.send(myMsg);
    queueCount += 1;
}
// // //If this is a header, doctor the variabledata to have header name and header timestamp name
if(msg.payload.variabledata[0].y === undefined){
    myMsg.payload = msg.payload.variablename;
    node.send(myMsg);
    queueCount += 1;
    numFields += 1;
}
// //We've already processed the header, now process the data and append numFields to the end!
else{
    // //Is this the first message in a new set?  If so, flush the downsteam q-gate
    // //before we send the message
    if(queueCount >= numFields){
        //Send the complete message so that the downstead join will know to join
        node.send({complete:true});
        //Flush the queue of the downstream gate if this message is not from the previous set
        node.send({topic:"control", payload:"flush"})
        queueCount = 0;
        sentTimestampVal = true;
        myMsg.payload = msg.payload.variabledata[0].x;
        node.send(myMsg);
        queueCount += 1;
    }
    //Only now are we sure we can simply send the payload we were 
    //originally given (no additional q-gate control or timestamp)
    //messages need to be sent
    myMsg.payload = msg.payload.variabledata[0].y;
    node.send(myMsg);
    queueCount += 1;
}





//Save environment variables for next time around
flow.set('numFields', numFields);
flow.set('queueCount', queueCount);
flow.set('foundNumFields',foundNumFields);
flow.set('sentTimestampVal',sentTimestampVal);


return;

